import NavBar from './components/NavBar';
import Home from './components/HomePage';
import './App.css';
import { ChakraProvider} from '@chakra-ui/react';
import theme from './index'


function App({ Component }) {
  return (
    <ChakraProvider theme={theme}>
      <NavBar />
      <Home h="100vh"/>
    </ChakraProvider>
  );
}

export default App;
